  ['arduino_20library_20that_20builds_20switch_20mechanisms_20replacements_20out_20of_20simple_20push_20buttons_79',['An Arduino library that builds switch mechanisms replacements out of simple push buttons.',['../index.html#an-arduino-library-that-builds-switch-mechanisms-replacements-out-of-simple-push-buttons',1,'']]],
  ['are_20mpbs_20whose_20distinctive_20characteristic_20is_20that_20implement_20non_20latching_20switches_20that_20while_20being_20pressed_20their_20state_20might_20change_20from_20strong_20on_20state_20strong_20to_20a_20strong_20voided_20state_20strong_20due_20to_20different_20voiding_20conditions_80',['&lt;strong&gt;Voidable DD-MPBs&lt;/strong&gt; are MPBs whose distinctive characteristic is that implement non-latching switches that while being pressed their state might change from &lt;strong&gt;On State&lt;/strong&gt; to a &lt;strong&gt;Voided state&lt;/strong&gt; due to different voiding conditions.',['../index.html#voidable-dd-mpbs-are-mpbs-whose-distinctive-characteristic-is-that-implement-non-latching-switches-that-while-being-pressed-their-state-might-change-from-on-state-to-a-voided-state-due-to-different-voiding-conditions',1,'']]],
  ['are_20mpbs_20whose_20distinctive_20characteristic_20is_20that_20models_20switches_20that_20keep_20the_20on_20state_20since_20the_20moment_20the_20input_20signal_20is_20stable_20debouncing_20delay_20process_20and_20keeps_20the_20on_20state_20after_20the_20mpb_20is_20released_20and_20until_20an_20event_20un_20latches_20them_20setting_20them_20free_20to_20go_20back_20to_20the_20strong_20off_20state_20strong_81',['&lt;strong&gt;Latched DD-MPBs&lt;/strong&gt; are MPBs whose distinctive characteristic is that models switches that keep the ON state since the moment the input signal is stable (debouncing + Delay process), and keeps the ON state after the MPB is released and until an event un-latches them, setting them free to go back to the &lt;strong&gt;Off State&lt;/strong&gt;.',['../index.html#latched-dd-mpbs-are-mpbs-whose-distinctive-characteristic-is-that-models-switches-that-keep-the-on-state-since-the-moment-the-input-signal-is-stable-debouncing--delay-process-and-keeps-the-on-state-after-the-mpb-is-released-and-until-an-event-un-latches-them-setting-them-free-to-go-back-to-the-off-state',1,'']]],
  ['are_20mpbs_20whose_20distinctive_20characteristic_20is_20that_20models_20switches_20that_20present_20different_20behaviors_20based_20on_20the_20strong_20time_20length_20strong_20of_20the_20presses_20detected_20and_20the_20strong_20sequence_20strong_20of_20the_20short_20and_20long_20presses_82',['&lt;strong&gt;Double Action Latched DD-MPB&lt;/strong&gt; are MPBs whose distinctive characteristic is that models switches that present different behaviors based on the &lt;strong&gt;time length&lt;/strong&gt; of the presses detected and the &lt;strong&gt;sequence&lt;/strong&gt; of the short and long presses.',['../index.html#double-action-latched-dd-mpb-are-mpbs-whose-distinctive-characteristic-is-that-models-switches-that-present-different-behaviors-based-on-the-time-length-of-the-presses-detected-and-the-sequence-of-the-short-and-long-presses',1,'']]],
  ['are_20started_20that_20means_20setting_20the_20strong_20ison_20strong_20attribute_20flag_20and_20calling_20the_20strong_20fnwhntrnon_20strong_20function_20the_20driving_20concept_20is_20to_20instantiate_20a_20mpbttn_20that_20generates_20only_20one_20possible_20strong_20ison_20strong_20attribute_20flag_20true_20readout_20and_20the_20associated_20function_20execution_20just_20like_20a_20single_20shot_20trigger_83',['The &lt;strong&gt;Single Service Voidable Momentary Push Button&lt;/strong&gt; keeps the &lt;strong&gt;On state&lt;/strong&gt; since the moment the signal is stable (debounce &amp; delay process) and until the moment the provided mechanisms implemented to be executed when the switch enters the &lt;strong&gt;On State&lt;/strong&gt; are started, that means setting the &lt;strong&gt;isOn&lt;/strong&gt; attribute flag and calling the &lt;strong&gt;fnWhnTrnOn&lt;/strong&gt; function. The driving concept is to instantiate a MPBttn that generates only one possible &lt;strong&gt;isOn&lt;/strong&gt; attribute flag true readout and the associated function execution, just like a single shot trigger.',['../index.html#the-single-service-voidable-momentary-push-button-keeps-the-on-state-since-the-moment-the-signal-is-stable-debounce--delay-process-and-until-the-moment-the-provided-mechanisms-implemented-to-be-executed-when-the-switch-enters-the-on-state-are-started-that-means-setting-the-ison-attribute-flag-and-calling-the-fnwhntrnon-function-the-driving-concept-is-to-instantiate-a-mpbttn-that-generates-only-one-possible-ison-attribute-flag-true-readout-and-the-associated-function-execution-just-like-a-single-shot-trigger',1,'']]],
  ['asking_20if_20the_20switch_20is_20on_20or_20off_20strong_84',['&lt;strong&gt;The driving concept is pretty simple: stop checking an input pin voltage, start asking if the switch is On or Off.&lt;/strong&gt;',['../index.html#the-driving-concept-is-pretty-simple-stop-checking-an-input-pin-voltage-start-asking-if-the-switch-is-on-or-off',1,'']]],
  ['associated_20function_20execution_20just_20like_20a_20single_20shot_20trigger_85',['The &lt;strong&gt;Single Service Voidable Momentary Push Button&lt;/strong&gt; keeps the &lt;strong&gt;On state&lt;/strong&gt; since the moment the signal is stable (debounce &amp; delay process) and until the moment the provided mechanisms implemented to be executed when the switch enters the &lt;strong&gt;On State&lt;/strong&gt; are started, that means setting the &lt;strong&gt;isOn&lt;/strong&gt; attribute flag and calling the &lt;strong&gt;fnWhnTrnOn&lt;/strong&gt; function. The driving concept is to instantiate a MPBttn that generates only one possible &lt;strong&gt;isOn&lt;/strong&gt; attribute flag true readout and the associated function execution, just like a single shot trigger.',['../index.html#the-single-service-voidable-momentary-push-button-keeps-the-on-state-since-the-moment-the-signal-is-stable-debounce--delay-process-and-until-the-moment-the-provided-mechanisms-implemented-to-be-executed-when-the-switch-enters-the-on-state-are-started-that-means-setting-the-ison-attribute-flag-and-calling-the-fnwhntrnon-function-the-driving-concept-is-to-instantiate-a-mpbttn-that-generates-only-one-possible-ison-attribute-flag-true-readout-and-the-associated-function-execution-just-like-a-single-shot-trigger',1,'']]],
  ['attribute_20flag_20and_20calling_20the_20strong_20fnwhntrnon_20strong_20function_20the_20driving_20concept_20is_20to_20instantiate_20a_20mpbttn_20that_20generates_20only_20one_20possible_20strong_20ison_20strong_20attribute_20flag_20true_20readout_20and_20the_20associated_20function_20execution_20just_20like_20a_20single_20shot_20trigger_86',['The &lt;strong&gt;Single Service Voidable Momentary Push Button&lt;/strong&gt; keeps the &lt;strong&gt;On state&lt;/strong&gt; since the moment the signal is stable (debounce &amp; delay process) and until the moment the provided mechanisms implemented to be executed when the switch enters the &lt;strong&gt;On State&lt;/strong&gt; are started, that means setting the &lt;strong&gt;isOn&lt;/strong&gt; attribute flag and calling the &lt;strong&gt;fnWhnTrnOn&lt;/strong&gt; function. The driving concept is to instantiate a MPBttn that generates only one possible &lt;strong&gt;isOn&lt;/strong&gt; attribute flag true readout and the associated function execution, just like a single shot trigger.',['../index.html#the-single-service-voidable-momentary-push-button-keeps-the-on-state-since-the-moment-the-signal-is-stable-debounce--delay-process-and-until-the-moment-the-provided-mechanisms-implemented-to-be-executed-when-the-switch-enters-the-on-state-are-started-that-means-setting-the-ison-attribute-flag-and-calling-the-fnwhntrnon-function-the-driving-concept-is-to-instantiate-a-mpbttn-that-generates-only-one-possible-ison-attribute-flag-true-readout-and-the-associated-function-execution-just-like-a-single-shot-trigger',1,'']]],
  ['attribute_20flag_20kept_20updated_20for_20each_20and_20every_20class_20is_20the_20strong_20ison_20strong_20flag_20which_20defines_20the_20em_20strong_20off_20state_20strong_20em_20ison_20false_20and_20the_20em_20strong_20on_20state_20strong_20em_20ison_20true_20of_20the_20instantiated_20objects_87',['The main output attribute flag kept updated for each and every class is the &lt;strong&gt;isOn&lt;/strong&gt; flag, which defines the &lt;em&gt;&lt;strong&gt;Off State&lt;/strong&gt;&lt;/em&gt; (isOn=false) and the &lt;em&gt;&lt;strong&gt;On State&lt;/strong&gt;&lt;/em&gt; (isOn=true) of the instantiated objects.',['../index.html#the-main-output-attribute-flag-kept-updated-for-each-and-every-class-is-the-ison-flag-which-defines-the-_off-state_-isonfalse-and-the-_on-state_-isontrue-of-the-instantiated-objects',1,'']]],
  ['attribute_20flag_20true_20readout_20and_20the_20associated_20function_20execution_20just_20like_20a_20single_20shot_20trigger_88',['The &lt;strong&gt;Single Service Voidable Momentary Push Button&lt;/strong&gt; keeps the &lt;strong&gt;On state&lt;/strong&gt; since the moment the signal is stable (debounce &amp; delay process) and until the moment the provided mechanisms implemented to be executed when the switch enters the &lt;strong&gt;On State&lt;/strong&gt; are started, that means setting the &lt;strong&gt;isOn&lt;/strong&gt; attribute flag and calling the &lt;strong&gt;fnWhnTrnOn&lt;/strong&gt; function. The driving concept is to instantiate a MPBttn that generates only one possible &lt;strong&gt;isOn&lt;/strong&gt; attribute flag true readout and the associated function execution, just like a single shot trigger.',['../index.html#the-single-service-voidable-momentary-push-button-keeps-the-on-state-since-the-moment-the-signal-is-stable-debounce--delay-process-and-until-the-moment-the-provided-mechanisms-implemented-to-be-executed-when-the-switch-enters-the-on-state-are-started-that-means-setting-the-ison-attribute-flag-and-calling-the-fnwhntrnon-function-the-driving-concept-is-to-instantiate-a-mpbttn-that-generates-only-one-possible-ison-attribute-flag-true-readout-and-the-associated-function-execution-just-like-a-single-shot-trigger',1,'']]]
